INSERT INTO `ps_cms_lang` VALUES
('1','1','1','Metody dostawy',NULL,'O metodach dostawy w naszym sklepie','conditions, delivery, delay, shipment, pack','<h2>Metody dostawy</h2>\n<p>Posiadamy dwie metody dostawy:</p>\n<ul>\n<li>InPost paczkomaty</li>\n<li>InPost kurier</li>\n</ul>\n<p>W przypadku obu metod, płatność można zrealizować jedynie wykonując przelew bankowy na konto podane w mailu po złożeniu zamówienia. Dla metody kurierem, istnieje również możliwość płatności przy odbiorze.</p>\n<h2>Opakowanie</h2>\n<p>Wszystkie zamówienia zostają zapakowane w odpowiednim rozmiarze paczki, odpowiednio zapakowane, żeby jak najlepiej zabezpieczyć książki przed każdymi możliwymi uszkodzeniami.</p>','metody-dostawy'),
('3','1','1','Regulamin sklepu',NULL,'O regulaminie naszego sklepu','conditions, terms, use, sell','<h2>Regulamin sklepu</h2>\n<ol>\n<li>Zwroty do 7 dni od otrzymania zamówienia.</li>\n<li>Wysyłka do 3 dni od złożenia zamówienia.</li>\n<li>7 dni na dokonanie płatności po złożeniu zamówienia.</li>\n<li>Bądź sobą i baw się dobrze ;)</li>\n</ol>','regulamin-sklepu'),
('4','1','1','O nas',NULL,'Dowiedz sie więcej o nas','about us, informations','<h2>O nas</h2>\n<h3>Nasz sklep</h3>\n<p>Sklep założony przez dwójkę przyjaciół z marzeniem o zostaniu sklepem numer 1 w dostarczaniu książek do czytelników po jak najniższej cenie.</p>\n<h3>Nasz zespół</h3>\n<p>Maurycy Książkowski - właściciel, menadżer</p>\n<p>Pasachazy Książkowski - właściciel, webmaster, obsługa klienta</p>','o-nas'),
('5','1','1','Metody płatności',NULL,'O metodach płatności w naszym sklepie','secure payment, ssl, visa, mastercard, paypal','<h2>Metody płatności</h2>\n<h3>Przelew tradycyjny</h3>\n<p>Odbiorca: Maurycy Książkowski<br />Adres: Gabriela Narutowicza 11/12, 80-233 Gdańsk<br />Numer konta: PL 14 1090 2402 5724 7279 5599 2346<br />Tytuł przelewu: numer Twojego zamówienia</p>\n<p>Zaksięgowanie zajmuje około 1 dzień roboczy.</p>\n<h3>Płatność przy odbiorze</h3>\n<p>Możliwość opłacenia zamówienia u kuriera, kartą płatniczą lub gotówką.</p>','metody-platnosci');
