INSERT INTO `ps_product_lang` VALUES
('1','1','1','<div><div><div>Nowa powieść uwielbianej przez fanów Claudii Gray koncentruje się na pierwszych padawańskich latach Kenobiego<p>Świat Gwiezdnych wojen jest regularnie rozbudowywany na kartach wielu książek i komiksów, jednak od czasów Expanded Universe niewiele dodatków poświęcono relacji Obi-Wana Kenobiego i jego mistrza Qui-Gon Jinna. W swojej nowej powieści Claudia Gray wypełnia tę lukę, koncentrując się na wczesnym okresie ich współpracy, pierwszych padawańskich latach Kenobiego.</p><p>Dwaj Jedi zostają wysłani na planetę Pijal, by wesprzeć Raela Averrossa, rycerza, a zarazem lorda protektora młodej władczyni. Wkrótce odbędzie się uroczystość podpisania konstytucji, co ma wprowadzić nowy ustrój polityczny i sprawić, by świat ten zaczął pełnić istotną rolę gospodarczą w tym zakątku galaktyki. Jednak nie wszyscy poddani księżniczki Fanry wydają się być zachwyceni zmianami, czemu dają wyraz w brutalny sposób. Czy Obi-Wanowi i Qui-Gonowi uda się rozwikłać zagadkę i naprawić psujące się między nimi relacje?</p><p>Mistrz i uczeń to ciekawa próba przedstawienia postaci i historii Obi-Wana Kenobiego i Qui-Gon Jinna w nieco innym świetle, niż widzimy ją w Mrocznym widmie</p><p>Tutaj Jedi nie są kryształowi, bez skazy, poznajemy ich wady, a także pewne słabości i braki. Jak zawsze u Gray, bohaterowie są prawdziwi, z krwi i kości. Czytelnik kibicuje tym, którzy powinni wygrać, choć nie zawsze jest to jednoznaczne...</p><p>Książka skupia się nie tylko na wartko toczącej się akcji, ale także na bohaterach, do głównego duetu dołączają kolejne interesujące postaci, m.in. inny dawny padawan Dooku oraz międzygwiezdni podróżnicy, Pax Maripher i Rahara Wick. Długoletni fani uniwersum rozpoznają zapewne Korporację Czerka, a jej przedstawiciele odegrają ważną rolę w opowieści. Czytelnicy poznają również korzenie nietypowego zainteresowania Qui-Gona przepowiedniami (które – jak wiadomo – doprowadzi do zaakceptowania przez zakon Anakina Skywalkera), przy okazji starając się odgadnąć znaczenia przytoczonych proroctw.</p><p><strong>Powyższy opis pochodzi od wydawcy.</strong></p></div></div></div>',NULL,'mistrz-i-uczen-star-wars',NULL,NULL,NULL,'Mistrz i uczeń. Star Wars',NULL,NULL,NULL,NULL),
('2','1','1','<p>W dramatycznym finale trylogii \"Dynastia Trawna\" zagłada grozi całej dynastii Chissów.<br />Od tysięcy lat Dynastia Chissów stanowi wyspę spokoju w kosmosie. Jest ośrodkiem władzy i ostoją prawości. Dziewięć Rodzin Rządzących zapewnia jej stabilność polityczną w Chaosie Nieznanych Regionów. Równowagę tę naruszył jednak podstępny wróg, za sprawą którego wzajemne zaufanie pośród Chissów powoli zaczyna maleć. Wskutek rosnących napięć między rodzinami więzy lojalności zaczynają słabnąć. Pomimo starań Ekspansyjnej<br />Floty Obronnej Dynastia coraz szybciej zmierza ku wojnie domowej.<br />Chissom nieobca jest wojna. W Chaosie stali się legendą w związku z prowadzonymi przez siebie walkami i straszliwymi wydarzeniami, z których część popadła w zapomnienie - aż do tej pory. Aby chronić przyszłość Dynastii, Thrawn drąży głęboko w jej historii, odkrywając mroczne tajemnice związane z pierwszą Rodziną Rządzącą. Prawda o dziedzictwie rodziny ma jednak tylko taką moc, jak legenda, która ją otacza. Nawet jeśli legenda ta okaże się kłamstwem.<br />Czy dla ocalenia Dynastii Thrawn jest gotów poświęcić wszystko – w tym swój jedyny dom?</p><p>Timothy Zahn jest autorem ponad sześćdziesięciu powieści, prawie dziewięćdziesięciu opowiadań i nowel oraz czterech zbiorów opowiadań. W 1984 roku zdobył Nagrodę Hugo za najlepszą nowelę. Zahn jest najbardziej znany ze swoich powieści osadzonych w świecie Gwiezdnych wojen (Thrawn, Thrawn: Sojusze, Thrawn: Zdrada, Dziedzic Imperium, Ciemna Strona Mocy, Ostatni rozkaz, Widmo przeszłości, Wizja przyszłości, Rozbitkowie z Nirauan, Poza galaktykę, Posłuszeństwo, Ręka sprawiedliwości i Skok millenium). Wydrukowano ponad osiem milionów egzemplarzy jego książek. Inne książki to StarCraft: Evolution, seria Kobra, seria Quadrail i seria dla nastolatków Dragonback. Zahn uzyskał licencjat z fizyki na Uniwersytecie Stanu Michigan oraz tytuł magistra na Uniwersytecie Illinois.</p><p><strong>Powyższy opis pochodzi od wydawcy.</strong></p>',NULL,'star-wars-dynastia-thrawna-mniejsze-zlo',NULL,NULL,NULL,'Star Wars. Dynastia Thrawna. Mniejsze zło',NULL,NULL,NULL,NULL),
('3','1','1','<p>Trzeci tom porywającego cyklu o dziewczynie, która w miejscu odleglejszym niż gwiazdy usiłuje uratować przed zagładą swój ukochany świat.</p><p>Życie Spensy jako pilota Sił Powietrznych Śmiałych było naprawdę niezwykłe. Okazała się jednym z najlepszych pilotów myśliwskich ludzkiej enklawy na Detritusie i uratowała wszystkich jego mieszkańców przed zagładą z rąk Krelli - enigmatycznych obcych istot, które więziły ich tam od kilkudziesięciu lat. Co więcej, aby pod przykrywką zinfiltrować Zwierzchnictwo, udała się do jego odległego o lata świetlne centrum dowodzenia, gdzie dowiedziała się o istnieniu galaktyki pełnej zamieszkanych planet.</p><p>Teraz Zwierzchnictwo - będące galaktycznym sojuszem ciemiężącym ludzkość - rozpoczęło szeroko zakrojone dzialania wojenne. A Spensa widziała działanie broni, którą przeciwnik zamierza użyć - Wnikaczy, bedących prastarą, tajemniczą siłą, potrafiącą w mgnieniu oka niszczyć całe planety. Spensa wie, że SPŚ nie zdołają obronić przed nimi Detritusa, obojętnie ilu będą miały pilotow. Tylko że Spensa jest cytoniczką. Już stawiła czolo Wnikaczowi i dostrzegła w nim coś dziwnie znajomego. Może jeśli zdoła zrozumieć co to takiego, stanie się kimś więcej niż tylko jednym z wielu pilotow tej nadchodzącej wojny. Może zdoła ocalić galaktykę. Jednak aby odkryć kim naprawdę jest, musi pozostawić wszystko co zna i udać się w niebyt. Tam, skąd wróciło niewielu...</p><p>\"Zdumiewające scenerie, zapierające dech w piersiach zwroty akcji i błyskotliwe powietrzne bitwy… Współczesna odmiana space opery w najlepszym wydaniu!”.<br />\"Kirkus Reviews”</p><p><strong>Powyższy opis pochodzi od wydawcy.</strong></p>',NULL,'cytoniczka-skyward-tom-3',NULL,NULL,NULL,'Cytoniczka. Skyward. Tom 3',NULL,NULL,NULL,NULL),
('4','1','1','<p>\"Diuna. Pani Kaladanu\" to drugi tom trylogii, która przedstawia wydarzenia sprzed czasów opisanych w \"Diunie\"</p><p>Lady Jessica, matka Paula i konkubina księcia Leto Atrydy. Wybory, których dokonała, ukształtowały Imperium. Pani Kaladanu musi jednak uporać się z konsekwencjami zdrady, której dopuściła się wobec Bene Gesserit. Musi zdecydować, czy ważniejsza jest lojalność wobec starożytnego zakonu czy miłość do rodziny.</p><p>Tymczasem wydarzenia w Imperium nabierają tempa i nie panuje nad nimi nawet matka przełożona, a rodzina lady Jessiki znalazła się na kursie kolizyjnym z przeznaczeniem.</p><p><strong>Powyższy opis pochodzi od wydawcy.</strong></p>',NULL,'pani-kaladanu-diuna-tom-2',NULL,NULL,NULL,'Pani Kaladanu. Diuna. Tom 2',NULL,NULL,NULL,NULL),
('5','1','1','<p>W książce Stanisław Lem podejmuje jeden z najpopularniejszych tematów literatury fantastycznej - czyli kontaktu, z obcą cywilizacją, odmienną formą życia, i nieznanym. I to właśnie dlatego \"Solaris\" wciąż fascynuje.</p><div style=\"text-align:center;\"> </div>',NULL,'solaris',NULL,NULL,NULL,'Solaris',NULL,NULL,NULL,NULL),
('6','1','1','<p>Trzydziestodwuletni Charlie Gordon jest upośledzony umysłowo, ma iloraz inteligencji na poziomie 68 punktów. Uczy się czytać i pisać na zajęciach w Beekman College. Dwaj naukowcy z tej uczelni, doktor Nemur i doktor Strauss, prowadzą badania nad wzrostem inteligencji. Udało im się już za pomocą zabiegu chirurgicznego zwiększyć zdolności umysłowe myszy o imieniu Algernon i teraz chcą przeprowadzić taki sam eksperyment z człowiekiem.</p><p><strong>Powyższy opis pochodzi od wydawcy.</strong></p>',NULL,'kwiaty-dla-algernona',NULL,NULL,NULL,'Kwiaty dla Algernona',NULL,NULL,NULL,NULL),
('7','1','1','<p>Drugi omnibus z  kolekcji utworów legendarnych braci Strugackich.<br /><br />Powieści \"Wywrócony świat\", \"Żuk w mrowisku\" oraz \"Fale tłumią wiatr\" składają się na quasi-trylogię, którą w luźną całość łączy postać Maksa Kammerera, kosmonauty, odkrywcy, buntownika, śledczego. W tych różnych rolach Kammerer prowadzi nierówną walkę - w \"Wywróconym świecie\" z bezdusznym reżimem manipulującym społeczeństwem na innej planecie za pomocą technologii, w \"Żuku w mrowisku\" z bliżej nieokreślonym zagrożeniem dla ludzkości ze strony tajemniczego uciekiniera - zwiadowcy Abałkina, a w \"Falach… \" wspomaga młodego śledczego Tojwo Glumowa w demaskowaniu tajemniczej grupy terrorystycznej. Wieloletnie zmagania Kammerera stają się dla Strugackich pretekstem do zaskakująco aktualnych refleksji o losie jednostki w systemie totalitarnym, o mechanizmach rządzących tworzeniem się elit i pseudoelit, o nieprzemijającym lęku przed wojną i terrorem, który prowadzi społeczeństwo do rezygnacji z wolności. W 2008 roku na podstawie powieści \"Wywrócony świat\" powstał film w reżyserii Fiodora Bondarczuka.<br />Czwarta powieść w omnibusie, czyli \"Niepokój\", to pierwotna wersja \"Ślimaka na zboczu\", opublikowana dopiero w 1990 roku, która pojawia się po raz pierwszy w polskim tłumaczeniu. Sami Strugaccy wrócili do tego pierwszego wariantu po 25 latach od powstania i uznali, że stanowi on samodzielną opowieść poza kontekstem uniwersum \"Świata Południa\".<br /><br />Tom zawiera cztery utwory:</p><ul><li>\"Żuk w mrowisku\"</li><li>\"Fale tłumią wiatr\"</li><li>\"Wywrócony świat\"</li><li>\"Niepokój\"</li></ul><p><strong>Powyższy opis pochodzi od wydawcy</strong></p>',NULL,'wywrocony-swiat-i-inne-utwory',NULL,NULL,NULL,'Wywrócony świat i inne utwory',NULL,NULL,NULL,NULL),
('8','1','1','<p>Arrakis, zwana Diuną, to jedyne we wszechświecie źródło melanżu. Z rozkazu Padyszacha Imperatora planetę przejmują Atrydzi, zaciekli wrogowie władających nią dotychczas Harkonnenów. Zwycięstwo księcia Leto Atrydy jest jednak pozorne – przejęcie planety ukartowano. W odpowiedzi na atak Imperium i Harkonnenów dziedzic rodu Atrydów Paul staje na czele rdzennych mieszkańców Diuny i sięga po imperialny tron. Oszałamiające połączenie przygody i mistycyzmu, ekologii i polityki.</p><p>\"Diuna\" otrzymała dwie najbardziej prestiżowe nagrody SF: Nebula i Hugo.</p><p>Dom Wydawniczy REBIS oddaje czytelnikom nowe, poprawione wydanie cyklu \"Kroniki Diuny\", który tworzą: Diuna, Mesjasz Diuny, Dzieci Diuny, Bóg Imperator Diuny, Heretycy Diuny i Kapitularz Diuną.</p><p><strong>Powyższy opis pochodzi od wydawcy.</strong></p>',NULL,'diuna-kroniki-diuny-tom-1',NULL,NULL,NULL,'Diuna. Kroniki Diuny. Tom 1',NULL,NULL,NULL,NULL),
('9','1','1','<p>Minęło kilkanaście lat, odkąd Fremeni pod dowództwem Paula Muad\'Diba pokonali połączone siły Harkonnenów i imperialnych sardaukarów. Paul poślubił księżniczkę Irulanę i zasiadł na tronie Imperium. Pustynna Arrakis, zwana Diuną, jest stolicą wszechświata, a Imperator Paul Atryda wydaje z niej poprzedzone proroczymi wizjami rozkazy. Tymczasem stare ośrodki władzy - Bene Gesserit, Gildia Kosmiczna i Bene Tleilax - zawiązują spisek przeciw nowemu Imperatorowi.</p><p>Czczony niczym bóg, Paul Muad’Dib wpada w pułapkę, jaką zastawiła na niego prorocza moc: zna dokładnie każdą chwilę swojej przyszłości, każdy swój ruch, każdą decyzję i — przede wszystkim — swój straszliwy finał...</p><p>Dom Wydawniczy REBIS oddaje czytelnikom nowe, poprawione wydanie cyklu „Kroniki Diuny”, który tworzą: Diuna, Mesjasz Diuny, Dzieci Diuny, Bóg Imperator Diuny, Heretycy Diuny i Kapitularz Diuną.</p><p><strong>Powyższy opis pochodzi od wydawcy.</strong></p>',NULL,'mesjasz-diuny-kroniki-diuny-tom-2',NULL,NULL,NULL,'Mesjasz Diuny. Kroniki Diuny. Tom 2',NULL,NULL,NULL,NULL),
('10','1','1','<p><strong>Pakiet <em>Kroniki Diuny</em></strong></p><p>Frank Herbert</p><p>Jeśli jesteś fanem literatury science fiction, nie pozostaniesz obojętny wobec serii stworzonej przez Franka Herberta pt. <em>Kroniki Diuny</em>. Spodziewaj się przygody w najlepszym wydaniu, która łączy w sobie elementy polityki, ekologii i mistycyzmu. Być może widziałeś już najnowszą ekranizację <em>Diuny</em>? Jeśli chcesz poznać wersję książkową tej historii, sięgnij po pakiet <em>Kroniki Diuny</em>.</p><p><strong>Pakiet pełen przygód</strong></p><p>Wspomniany pakiet obejmuje sześć części poprawionych <em>Kronik Diuny</em>, a mianowicie następujące pozycje: <em>Diuna</em>, <em>Mesjasz Diuny</em>, <em>Dzieci Diuny</em>, <em>Bóg Imperator Diuny</em>, <em>Heretycy Diuny</em> i <em>Kapitularz Diuną</em>. W pierwszym tomie <em>Kronik </em>poznajemy Arrakis, zwane Diuną, czyli źródło melanżu, który jest substancją umożliwiającą wydłużenie życia. Diuna pozwala bohaterom także na odbywanie podróży kosmicznych i przewidywanie zdarzeń, które wydarzą się w przyszłości.</p><p>Jak możesz się domyślać, wszyscy chcą przejąć Diunę. W pierwszej części cyklu dotychczas rządzący źródłem Harkonnenowie opuszczają planetę, a Diunę przejmują jako lenno Atrydzi, z którymi walczyli. Planetą rządzi odtąd książę Leto, ale jego wygrana jest pozorna. Wkrótce na czele mieszkańców Diuny staje Paul, dziedzic rodu Atrydów. Walczy z połączonymi siłami Imperium i Harkonnenów. Czy wygra?</p><p><strong>Jedyna w swoim rodzaju powieść</strong></p><p><em>Diuna</em> jest opowieścią snutą w sposób bardzo konsekwentny, z niezwykłą fantazją. Jej złożoność dotyczy przede wszystkim wykreowanego świata fantastycznego. Niektórzy krytycy przyrównują ją do pisarstwa Tolkiena. Czy rzeczywiście jest tak dobra?</p>',NULL,'pakiet-kroniki-diuny',NULL,NULL,NULL,'Pakiet: Kroniki Diuny',NULL,NULL,NULL,NULL);
